import React from "react";
import App from "../App";

class AddButton extends React.Component {
  render() {
    return (
      <div className="AddButton">
            <button className="AddButton" onClick="{this.togglePopup.bind(this)}">+</button>
      </div>
    );
  }
}
export default AddButton;
